import React from "react";

export default function Row({ wordLength, guess }) {
  if (guess) {
    return (
      <div className="row past">
        {guess.map((l, i) => (
          <div key={i} className={l.color}>
            {l.key}
          </div>
        ))}
      </div>
    );
  }

  return (
    <div>
      <div className="row">
        {Array.from({ length: wordLength }, (_, index) => (
          <div key={index} className="box-style"></div>
        ))}
      </div>
    </div>
  );
}
